sys_extension_point.example:
/* global Class */
/* eslint no-undef: "error" */
var JSLibFactory = Class.create();
JSLibFactory.prototype = {
	initialize: function () {

	},

	factory: function (libs) {
		/**
		 * This example's outcome:
		 * var libs = new JSLibs();
		 * var myLib = libs.require('JSLibFactory');
		 * var x = new myLib();
		 * assert('hello world' == x.myFunc('hello world'));
		 */
		var require = libs.require;
		return function () {
			this.myFunc = function (arg1) {
				return arg1;
			};
		};
	},

	type: 'JSLibFactory'
};
